import React from "react";

function Catalog () {
  return (
    <section className="catalog">
      <div className="catalog-box">
        <img src="https://www.kino-teatr.ru/movie/poster/143787/145621.jpg"></img>
        <h5>Name</h5>
      </div>
    </section>
  );
}

export default Catalog;
